"use strict";

angular.module('SSNoC')
    .controller('directoryController', function ($scope, $http, $location, ChatPrivately, socket, User, $base64) {
        // var users=[];
        $http.get('/users').then(function (response) {
            $scope.currentUser = User.getUsername();
            $scope.users = response.data;
            // users=$scope.users;
            for (var i in $scope.users) {
                $scope.users[i].ONLINE = "Checking online...";
                $scope.users[i].image = $base64.decode("");
                // users.push($scope.users[i].NAME);
                socket.emit('check_online', {
                    "user": $scope.users[i].NAME,
                    "index": i
                });


                $http.get('/profile/' + $scope.users[i].NAME+"?i="+i).then(function(response) {
                    var profiles = response.data[0];
                    if(profiles!=null) {
                        // $scope.users[i].image=$base64.decode(profiles.image);
                        $scope.users[response.data[0].i].image=profiles.image;
                    }
                });
            }

        });
       
        
        $scope.sendUserName = function (targetUser) {
            ChatPrivately.setUsername(targetUser);
            $location.path('/chatprivately');
        };

        $scope.updateprofile=function(targetUser){
            console.log("updateprofile!!!!");
            console.log(targetUser);
            var username = User.getUsername();
            console.log(username);
            ChatPrivately.setUsername(targetUser);
            if(username===targetUser){
                 $location.path('/updateProfile');
            }
           
        };

        $scope.checkProfile=function(targetUser){
          console.log(targetUser);
          ChatPrivately.setUsername(targetUser);
          $location.path('/checkProfile');
        };
        
        socket.on('check_online', function (user) {
            $scope.users[user.index].ONLINE = user.online;
        });

        socket.on('update_status', function (user) {
            for (var i in $scope.users) {
                if ($scope.users[i].NAME === user.user_name) {
                    $scope.users[i].STATUS = user.status;
                    break;
                }
            }
        })

    });
